      <div>
        <img src={eggsvg} className="easteregg" onClick={props.onClick} />
      </div>
    )
  }
  else {
    return (
      <div onClick={props.onClick}>
        <p>LL Made<br />by Lauren, Phil, James, and Damina</p>
      </div>
    )
  }

}

